import React from "react";
import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import Time from "./Time"


function Header() {

  return (
    <header> 
       <Time className=""/>
      <h1>
        <FilterVintageIcon 
        className="icon" 
        fontSize="large" />
        <FilterVintageIcon 
        className="icon" 
        fontSize="medium"/> 
        Save a note
        <FilterVintageIcon 
        className="icon"  
        fontSize="medium"/>
        <FilterVintageIcon 
        className="icon" 
        fontSize="large"/>
      </h1>
    </header>
  );
}

export default Header;
